import {ArrowBackOutlined} from "@material-ui/icons";
import "./Watch.scss";

export default function Watch() {
    return (
        <div className="watch">
            <div className="back">
                <ArrowBackOutlined />
                Home
            </div>
            <video
                className="video"
                autoPlay
                progress
                controls
                src="https://vn.pikbest.com/video/current-particle-light-effect-convergence-interpretation-logo-film-title-ae-template_203627.html"
            />
        </div>
    );
}
